import React from "react";
import styled from "styled-components";
import Weather_BG from "../assets/images/weather-bg.png";

const WeatherStyles = styled.div`
  .container {
    width: 100%;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    background-image: url(${Weather_BG});
  }
`;

export default function Weather() {
  return (
    <WeatherStyles>
      <div className="container">
        <input type="text" name="city" placeholder="country"/>
      </div>
    </WeatherStyles>
  );
}
